?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Одна из самых старейших швейцарских компаний по производству часов была основана в 1848 году. Изначально, это была обычная мастерская, в которой производилась сборка часов. Создатель этой мастерской Луи Брандт специализировался на сборке карманных часов из деталей, которые привозили ему местные ремесленники. После сборки нескольких десятков часов, он отправился в путешествие по Европе, где заодно и продавал свои часы (а пользовались они стабильным спросом). После того, как в 1879 году Луи умер, оба его сына решили превратить мастерскую в часовую фабрику, где производились и детали, и сборка. В 1884 году, братьями был изобретен 19-линейный калибр под названием <span lang="EN-US">Omega</span>, который стал очень популярным. После смерти братьев, фабрика достается в наследство четырем сыновьям. И, благодаря одному из них, Полю-Эмилю, компания стала всемирно популярной и преодолела экономический кризис. Начиная с 1932 года, компания начала заниматься разработкой водонепроницаемых часов, и в этот же год выпустила часы с водонепроницаемостью до 135 метров. После этого события, компания каждые 5 лет разрабатывала и выпускала часы с какой-либо инновационной функцией (которые, кстати говоря, компания сама разрабатывала). Компания <span lang="EN-US">Omega</span><span lang="EN-US"> </span>является официальным хронометристом нескольких спортивных соревнований. Часы <span lang="EN-US">Omega</span> – это выбор людей, предпочитающих модернизированную классику.</span></span></p>
 
<p><span style="font-size: medium;"><b><span style="font-family: &quot;Times New Roman&quot;;">Обозначения:</span></b></span><b><span style="font-size: 10pt; font-family: &quot;Times New Roman&quot;;"> <i>Both - смешанный режим (реверсивное вращение</i></span></b><b><i><span style="font-size: 10pt; font-family: &quot;Times New Roman&quot;;">); CW -&nbsp;</span></i></b><b><i><span style="font-size: 10pt; font-family: &quot;Times New Roman&quot;;">вращение по часовой стрелке; CCW – вращение против часовой стрелки; </span></i></b><i><span style="font-family: &quot;Times New Roman&quot;;">«</span></i><span style="font-size: 14pt; font-family: &quot;Times New Roman&quot;;">–</span><i><span style="font-family: &quot;Times New Roman&quot;;">»&nbsp;</span></i><b><i><span style="font-size: 10pt; font-family: &quot;Times New Roman&quot;; color: black;">не определено</span></i></b></p>
 
